(4, 1, '苏州创时云能源科技有限公司', '123456', '123456', '李世民', '秦琼', '18806202833', '姑苏区', '医药', '18806202833', '215000', '1042501341@qq.com', '123456', '经济开发区澄阳国际科技创业园', '经济开发区澄阳国际科技创业园', 120.615631, 31.328876, '../UnitPicture/1/csats.jpg', '唐朝（618年—907年[1]  ），是继隋朝之后的大一统王朝，共二十一位皇帝，享国二百八十九年。[2]  因皇室姓李，故又称为李唐。\n公元618年李渊在长安（今西安）称帝建立唐朝[3]  。唐太宗继位后开创贞观之治，其后唐高宗承贞观之遗风开创永徽之治，之后武则天一度以周代唐，神龙革命后恢复大唐国号。唐玄宗即位后励精图治，开创了极盛的开元盛世，[4]  天宝末，全国人口达八千万上下。[5-8]  安史之乱后藩镇割据、宦官专权导致国力渐衰，历经元和中兴、会昌中兴、大中之治后国势复振，末期爆发黄巢起义破坏了唐朝统治根基，907年朱温篡唐，唐朝覆亡，中国进入五代十国。', 13371.520, 439552.000, 439597.938, '通过审核', '0000-00-00 00:00:00', 0, '', '', NULL, NULL, NULL, NULL),
