DROP TRIGGER IF EXISTS `fold_data`;
DELIMITER //
CREATE TRIGGER `fold_data` AFTER INSERT ON `t_original_data`
 FOR EACH ROW begin
declare v_1 float(10,4);
declare v_2 float(10,4);
declare v_3 varchar(10);
declare v_4 varchar(20);
set v_1 = (select standard_equ_fold from (t_collecting_point as `a` inner join `t_energy_small_type` as `b` on `a`.`energy_small_tsn`=`b`.`tsn` )where `a`.tsn = new.point_tsn);
set v_2 = (select standard_equ_discount from (t_collecting_point as `a` inner join `t_energy_small_type` as `b` on `a`.`energy_small_tsn`=`b`.`tsn` )where `a`.tsn = new.point_tsn);
set v_3 = (select energy_big_type from (t_collecting_point as `a` inner join `t_energy_small_type` as `b` on `a`.`energy_small_tsn`=`b`.`tsn` )where `a`.tsn = new.point_tsn);
set v_4 = (select path_number from (t_collecting_point as `a` inner join `t_energy_small_type` as `b` on `a`.`energy_small_tsn`=`b`.`tsn` )where `a`.tsn = new.point_tsn);
values (null,new.enter_tsn,new.point_tsn,new.tsn,new.table_grade,v_3,v_4,new.phase_energy,new.phase_energy*v_1,new.phase_energy*v_2,new.import_time);
end
